Defendant Tlonda S Chambliss in court with attorney Darryl E. Smith.  Tyrone Martin St Junior appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, defense, Mary B., and defendant. 
 
AS TO COUNT 1:  The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 3 1/2 YEARS, CONSECUTIVE to any other sentence with credit for 0 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 2 YEARS.

The defendant IS eligible for the Challenge Incarceration Program and the Substance Abuse Program.

The Court STAYED this sentence and placed the defendant on probation for a period of 3 YEARS with the following conditions:

CONDITIONS OF PROBATION/EXTENDED SUPERVISION:
*Serve 4 1/2 months in the House of Correction with release privileges for employment, treatment, and childcare- STAYED until 12-26-14, 3pm.  After serving the first 30 days of this condition time the defendant shall be granted electronic monitoring.  Good time allowed;
*Obtain AODA assessment- complete follow-up treatment;
*Absolute sobriety; no drugs or alcohol- random urine screens and breathalyzer tests;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Obtain/maintain full time employment or if enrolled in school full time, part time work;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;
*Pay all applicable mandatory surcharges, costs, and assessments by the end or probation period- any balance to convert to civil judgment;

AS TO COUNT 2:  The Court sentenced the defendant to serve 4 months in the House of Correction, Concurrent to Count 1/Consecutive to any other sentence.  The Court orders Huber privileges for employment, treatment, and childcare.  After serving the first 30 days of this condition time in the House of Correction the defendant shall be granted electronic monitoring.  Sentence STAYED until 12-26-14, 3pm.  Good time allowed.   The Court ordered defendant to pay a fine of $350.00 plus all mandatory costs, penalties, surcharges, including $50.00 ignition interlock surcharge by the end of probation period in Count 1.  Any remaining balance to convert to civil judgment.   Court ordered AODA assessment and Driver's Safety Plan; cooperate with any treatment recommended.  Court ordered defendant's driving privileges revoked for a period of 18 months.  Court ordered defendant restricted to operation of vehicles equipped with an ignition interlock device for 1 year. 

AS TO BOTH COUNTS.  
The state in compliance with victim rights legislation; restitution set at zero.  If revoked, The Court ordered that all financial obligations be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  Appeal rights given.
